import React, { Component } from "react";

class Education extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <form>
          <label>
            Institution :
            <input type="text" onChange={this.props.setEducation} />
          </label>
          <label>
            Graduation Date :
            <input type="text" onChange={this.props.setEducation} />
          </label>
          <label>
            Description :
            <input type="text" onChange={this.props.setEducation} />
          </label>
          <label>
            City :
            <input type="text" onChange={this.props.setEducation} />
          </label>
          <label>
            State :
            <input type="text" onChange={this.props.setEducation} />
          </label>
        </form>
      </div>
    );
  }
}

export default Education;
